import React, { useEffect, useState } from 'react';
import Papa from 'papaparse';

const Parser =()=> {
    const [parsedCsvData, setParsedCsvData] = useState([]);
    //const parseFile = file => {
    useEffect(() => {
        Papa.parse('https://docs.google.com/spreadsheets/d/e/2PACX-1vRUvD-Cab6I3vItJ3w1MNEiMM3L8wuJwre1hjE1WxNGERsi84ZdEkK1ZWcXaPaKPcrK2viV-aOSlAcg/pub?output=csv', {
            header: true,
            download: true,
            complete: results => {
              setParsedCsvData(results.data)

            },
          });
    },[])

    //};
    console.log(parsedCsvData)
    return(
        <>
        <div>Hej</div>
        <table>
        <thead>
            <tr>
            <th>Kanji</th>
            <th>Reading</th>
            <th>English</th>
            </tr>
        </thead>
        <tbody>
        {parsedCsvData &&
            parsedCsvData.map((parsedData, index) => (
            <tr key={index}>
                <td>{parsedData.Beskrivning}</td>
                <td>{parsedData.Titel}</td>
            </tr>
            ))}
        </tbody>
        </table>
        </>
    )
  }
  export default Parser
